const users = {
  state: {
    users: [
      { username: "user", password: "user", role: "client", status:false},
      { username: "manager", password: "manager", role: "manager", status:false },
      { username: "admin", password: "admin", role: "admin", status:false },
    ],
  },
  mutations: {},
  actions: {},
  getters: {},
};

export default users;
